import { Col, Container, Row } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import { Button } from "react-bootstrap";

const Footer = () => {
  return (
    <Container
      style={{ backgroundColor: "#252B3B", width: "100vw" }}
      className='footer w-100 text-white'
    >
      <Row className='mb-3'>
        <Col>team</Col>
        <Col>use cases</Col>
        <Col>Explore</Col>
        <Col>Resources</Col>
        <Col>Subscribe to our newsletter</Col>
      </Row>
      <Row>
        <Col>instagram</Col>
        <Col>UI design</Col>
        <Col>Costumers</Col>
        <Col>Supports</Col>
        <Col></Col>
      </Row>
      <Row>
        <Col>Facebook</Col>
        <Col>UX design</Col>
        <Col>Why I love figma</Col>
        <Col>Education</Col>
        <Col></Col>
      </Row>
    </Container>
  );
};
export default Footer;
